import React from "react";
//import logogov from "../../assets/images/header_govco.png"
//import logo from "../../assets/images/logocrc.jpg"

const Header = () => {
    return (
        <header className="header">
            <img 
                src="https://www.legalizaciones.mineducacion.gov.co/legalizacion/inc/govco/assets/images/logo-men.png" 
                height="70" alt="Logo Gov.co"></img>
        </header>
    )
}

export default Header
